import React from 'react';
import './Navegacion.css';
import {Link} from 'react-router-dom';
const Navegacion = () => {
    return ( 
        <nav className="navegacion">
            <Link to={'/nosotros'}>Nosotros</Link>
        </nav>
     );
}

export default Navegacion;
